class Gov:
    def __init__(self, index):
        self.index = index
        self.profit_list = []
        self.cost_list = []
        self.all_input_list = []
        self.all_output_list = []

class SysCal:
    def __init__(self, agent_num=0, profit=0, Tf=50, Th=20, Rh=20, Tei=10, Rd=20):
        self.num_gov = agent_num
        if profit is None:
            self.profit = 0
        else:
            self.profit = profit
        self.profit_list = []
        self.sum_profit_list = []
        self.sum_profit = 0
        
        # 系统效能
        self.utility = 0
        self.utility_list = []

        # 公平性
        self.fairness = 0
        self.fairness_list = []
        # 公平性度量周期
        self.Tf = Tf if Tf is not None else 10

        # 多样性
        self.variety = 0
        self.variety_list = []
        # 多样性度量周期
        self.Th = Th if Th is not None else 10
        # 多样性划分区间Rh
        self.Rh = Rh if Rh is not None else 20

        # 熵增速率
        self.entropy_increase = 0
        self.entropy_increase_list = []
        # 熵增速率度量周期
        self.Tei = Tei if Tei is not None else 10
        # 熵增速率划分区间Rd
        self.Rd = Rd if Rd is not None else 20

        self.w1 = 0.1
        self.w2 = 0.1
        self.w3 = 0.1
        self.w4 = 0.1

        # roi
        self.roi_list =[]

        self.input_system_cv_list = []
        self.input_all_system_cv_list = []
        self.output_system_cv_list = []
        self.output_all_system_cv_list = []

    def update_profit(self, money):
        self.profit = max(money, 0)
        self.profit_list.append(self.profit)
        self.sum_profit += self.profit
        self.sum_profit_list.append(self.sum_profit)


    def update_fairness(self, agents, current_step):
        self.fairness = 0
        start_index = max(0, current_step - self.Tf)
        x_gs = []
        for gov in agents:
            list_now = gov.profit_list[start_index:current_step]
            if len(list_now) < self.Tf:
                self.fairness_list.append(self.fairness)
                return
            x_gk = sum(list_now[-self.Tf:]) / self.Tf  # 取最后Tf个元素的平均值
            x_gs.append(x_gk)

        # 检查所有值是否与第一个值相同
        if all(x == x_gs[0] for x in x_gs):
            self.fairness = 100
        else:
            # 对x_gs进行排序
            x_gs_sorted = sorted(x_gs)
            
            # 计算基尼系数
            n = len(x_gs_sorted)
            sum_xg = sum(x_gs_sorted)
            cumulative_sum = [sum(x_gs_sorted[:i+1]) for i in range(n)]
            
            # 计算基尼系数
            gini = (1 / (n * sum_xg)) * sum((i * x_gs_sorted[i] - (i + 1) * x_gs_sorted[i - 1]) for i in range(1, n))
            
            # 将基尼系数转换为公平性指标，确保值在0-100范围内
            self.fairness = 100 * (1 - gini)

        self.fairness_list.append(max(100 - (100 - self.fairness) * 5, 0))

    def calculate_fairness(rewards):
        n = len(rewards)
        average_reward = sum(rewards) / n
        gini_coefficient = sum(abs(reward - average_reward) for reward in rewards) / (2 * n)
        fairness_index = 100 * (1 - gini_coefficient)
        return fairness_index


    def sigmoid(self,x):
        return 1 / (1 + np.exp(-x))

    def update_variety(self, agents, current_step):
        self.variety = 0
        profit_matrix = []

        # 收集每个agent在Th周期内每个时间步的收益
        for gov in agents:
            profit_list = gov.profit_list[current_step - self.Th + 1: current_step + 1]
            if len(profit_list) != self.Th:
                self.variety_list.append(self.variety)
                return
            profit_matrix.append(profit_list)

        # 转换为numpy数组方便处理
        profit_matrix = np.array(profit_matrix)

        # 检查所有时间步的收益是否完全一致
        if np.all(profit_matrix == profit_matrix[0]):
            self.variety = 0
        else:
            # 计算每个时间步的Shannon指数
            shannon_indices = []
            for step in range(self.Th):
                step_profits = profit_matrix[:, step]
                unique_profits, counts = np.unique(step_profits, return_counts=True)
                p_i = counts / len(step_profits)
                shannon_index = -np.sum(p_i * np.log2(p_i[p_i > 0]))
                shannon_indices.append(shannon_index)

            # 取平均Shannon指数
            average_shannon_index = np.mean(shannon_indices)

            # 使用Sigmoid函数放大变化
            self.variety = self.sigmoid(-average_shannon_index) * 100

        self.variety_list.append(self.variety)

    # 更新熵增速率
    def update_entropy_increase(self, agents, current_step):
        self.entropy_increase = 0
        profit_list1 = []
        profit_list2 = []
        for gov in agents:
            profit_list = gov.profit_list[current_step - self.Th + 1: current_step + 1]
            if len(profit_list) <= self.Tei:
                self.entropy_increase_list.append(self.entropy_increase)
                return
            profit_list1.append(profit_list[-1])  # 取当前周期的收益
            profit_list2.append(profit_list[-self.Tei])  # 取Tei周期前的收益

        # 计算Simpson指数
        def simpson_index(profits):
            counts = [profits.count(profit) for profit in set(profits)]
            total = len(profits)
            simpson = sum((count / total) ** 2 for count in counts)
            return 1 - simpson

        # 计算两个周期的Simpson指数
        simpson1 = simpson_index(profit_list1)
        simpson2 = simpson_index(profit_list2)

        # 计算熵增速率
        entropy_increase = (simpson1 - simpson2) / self.Tei

        # 将熵增速率转换到0-100的范围
        self.entropy_increase = (1 - abs(entropy_increase)) * 100

        # 确保值在0-100之间
        self.entropy_increase = max(0, min(100, self.entropy_increase))

        self.entropy_increase_list.append(max(100 - 200 * (100 - self.entropy_increase), 0))

    # 更新效能
    def update_utility(self):
        self.utility = self.w1 * self.profit + self.w2 * self.fairness + \
                       self.w3 * self.variety + self.w4 * self.entropy_increase
        self.utility_list.append(max(100 - 10 * (30 - self.utility), 0))

    # def update_roi(self, all_cost, all_money):
