    def update_roi(self, total_input, total_reward):
        """
        Updates the list of ROI values.

        Parameters:
        - total_input (float): The total input or cost.
        - total_reward (float): The total reward or money.
        """
        if total_input == 0 and len(self.roi_list):
            self.roi_list.append(self.roi_list[-1])
            return
        elif total_input == 0:
            self.roi_list.append(1)
            return
        
        roi = total_reward / total_input
        self.roi_list.append(roi)

    def calculate_cv(self, values):
        """Calculate the Coefficient of Variation (CV) for a given set of values."""
        mean = np.mean(values)
        std = np.std(values, ddof=1)  # Sample standard deviation (n-1 in denominator)
        if mean == 0:
            return 0  # Avoid division by zero
        return std / mean

    def update_input_system_cv(self, inputs):
        """Update the CV for the input system."""
        cv = self.calculate_cv(inputs)
        self.input_system_cv_list.append(cv)

    def update_input_all_system_cv(self, inputs_all):
        """Update the CV for all inputs in the system."""
        cv = self.calculate_cv(inputs_all)
        self.input_all_system_cv_list.append(cv)

    def update_output_system_cv(self, outputs):
        """Update the CV for the output system."""
        cv = self.calculate_cv(outputs)
        self.output_system_cv_list.append(cv)

    def update_output_all_system_cv(self, outputs_all, time_point):
        """Update the CV for all outputs in the system."""
        cv = self.calculate_cv(outputs_all)
        self.output_all_system_cv_list.append(cv)

    def process_csv_files(self, folder_path):
        # 初始化Gov类列表
        agents = []

        # 遍历文件夹中的所有CSV文件
        for filename in os.listdir(folder_path):
            if filename.endswith('.csv') and filename.startswith('deliver'):
                file_path = os.path.join(folder_path, filename)
                with open(file_path, mode='r') as file:
                    reader = csv.reader(file)
                    next(reader)  # 跳过标题行
                    gov_profit_list = []  # 存储当前Gov的profit列表
                    gov_input_list = []
                    gov_all_input = []
                    gov_all_output = []
                    init_cost = 0
                    init_money = 0
                    for row in reader:
                        # 假设每个CSV文件的最后一列是profit
                        profit = max(float(row[5]), 0)
                        cost = max(float(row[4]), 0) * 0.1
                        init_cost += float(row[4])
                        init_money += float(row[5])
                        gov_profit_list.append(profit)
                        gov_input_list.append(cost)
                        gov_all_input.append(init_cost)
                        gov_all_output.append(init_money)
                # 为每个CSV文件创建一个Gov实例
                gov_index = len(agents)
                agents.append(Gov(gov_index))
                agents[-1].profit_list = gov_profit_list
                agents[-1].cost_list = gov_input_list
                agents[-1].all_input_list = gov_all_input
                agents[-1].all_output_list = gov_all_output
                self.num_gov += 1

        # 所有Gov实例都已填充完毕，开始计算系统效能等指标
        self.calculate_system_metrics(agents)

    def calculate_system_metrics(self, agents):
        # 计算所有时刻的效能、公平性、多样性和熵增速率等指标
        for time_point in range(min(len(gov.profit_list) for gov in agents)):  # 找到最短的profit_list长度
            profits = sum([gov.profit_list[time_point] for gov in agents])
            costs = sum([gov.cost_list[time_point] for gov in agents])
            # print(time_point, profits)
            self.update_profit(profits)
            self.update_fairness(agents, time_point)
            self.update_variety(agents, time_point)
            self.update_entropy_increase(agents, time_point)
            self.update_utility()
            self.update_roi(sum([gov.all_output_list[time_point] for gov in agents]), sum([gov.all_input_list[time_point] for gov in agents]))
            self.update_input_system_cv([gov.cost_list[time_point] for gov in agents])
            self.update_output_system_cv([gov.profit_list[time_point] for gov in agents])
            self.update_input_all_system_cv([gov.all_input_list[time_point] for gov in agents])
            self.update_output_all_system_cv([gov.all_output_list[time_point] for gov in agents], time_point)

    def save_results_to_csv(self, file_path):
        with open(file_path, mode='w', newline='') as file:
            writer = csv.writer(file)
            # 写入标题行
            writer.writerow(['Utility', 'Fairness', 'Variety', 'entropy', 'roi', 'input', 'all_input', 'output', 'all_output'])
            # 写入数据行
            for i in range(len(self.utility_list)):
                writer.writerow([
                    self.utility_list[i],
                    self.fairness_list[i],
                    self.variety_list[i],
                    self.entropy_increase_list[i],
                    self.roi_list[i],
                    self.input_system_cv_list[i],
                    self.input_all_system_cv_list[i],
                    self.output_system_cv_list[i],
                    self.output_all_system_cv_list[i]
                ])
